import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import HomePage from "./HomePage";

ReactDOM.render(
  <div>
    <h1>My list!</h1>
    <ul>
      <li>hi</li>
      <li>I'am</li>
      <li>jishnu</li>
    </ul>
  </div>,
  document.getElementById("root")
);
